// https://atcoder.jp/contests/abc288/tasks/abc288_a

pub fn run(_n: i32, vec: Vec<Vec<i32>>) -> Vec<i32> {
    let mut ans = Vec::<i32>::new();

    for v in vec.iter() {
        ans.push(v[0] + v[1]);
    }

    ans
}

pub fn run2(_n: usize, vec: Vec<(i32, i32)>) -> Vec<i32> {
    vec.iter().map(|v| {
        v.0 + v.1
    }).collect::<Vec<i32>>()
}

